import React from 'react';
import { Button } from '@mui/material';

function ApiCredit() {
  return (
    <div class="api-credit-container">
      <h1>Api Credits</h1>
      <h2>Credits to "zzzzzzzzzzzzz" for providing the weather information through their api.</h2>
    </div>
  );
}

export default ApiCredit;
